import { Row, Col, Container } from "react-bootstrap";
import "../styling/footer.css";
import { useLocation } from "react-router-dom";
import wave from "../assets/footer-wave.svg";
import logo from "../assets/logo.png";

export const Footer = () => {
  const location = useLocation();
  return (
    <div className="footer">
      <Container>
       <Row>
        <Col xs={12} md={3} xl={2}>
          <img src={logo} alt="logo" className="img-fluid" />
        </Col>
        <Col xs={12} md={3} xl={2}>
          <h3>ABOUT US</h3>
          <br />
          <p>At thenujastore, we believe in the power of self-expression and individuality. <br />Our journey began with a simple idea: to provide unique, high-quality products that inspire and uplift our customers. Our mission is to empower you to express yourself authentically and confidently. </p>
        </Col>
       </Row>
        <Row className="copy">
          <p>thenujastore &copy; 2021</p>
        </Row>
      </Container>
    </div>
  );
};
